'1 BOTTLE ONLY',0,'N','','','N','N','N','BAROSSA VALLEY, AUSTRALIA'),(1314,'COHIBA SIGLO II',5,38.00,522,NULL,'Y',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge:42, Cigar Lenght:129mm/ 5.0 inches, Body: Medium - Full',0,'N','','','N','N','N','This little Mareva, or \r\nPedit Corona, has a sober and honest disposure. Made from the finest Vuelta Abajo tobaco, the siglo II is inviting to look at, tender to touch and very enticing to the nose. An occasional resistenceon the initial draw quickly leads into a steady burn.White pepper and Cohiba trademark grassy qualities are clearly apparent in the first half smoke.The second  and third tier release cocoa and vanilla beans on to the palate through an impressively thick smoke. This Pedit Corona is a great work-out for the palate and a true example of the Cohiba \"blend master\'s\" diligence.  '),(1315,'COHIBA SIGLO VI',5,68.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 52, Cigar Length: 150mm/5.9 inches,Body: Medium-Full',0,'N','','','N','N','N','Launched to commemorate ten years, of the Siglo series, this ciger is unctuously rich in complex flavours and is indisputably one of Cuba\'s finest cigars. Virile and refined, this habana spills out od creamy notes of leather, cocoa and sweet spice.The powder of the Siglo VI is transitional but never obtrusive, a gracious journey. With age, these cigars will mature with the grace of a vintage Rolls Royce. An indispensable must for any aficionado.'),(1316,'HOYO DE MONTERREY EPICURE NO. 2',5,38.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 50, Cigar Length: 124mm/4.8 inches,  Body: Medium',0,'N','','','N','N','N','A darling among Robusto lovers, this agreeable cigar has gained fame through its subtle floral nuances and intriguing twinges of sweet ginger and cinnamon. The tobaco, grown in the famed Vuelta Abajo region, is yet another mark of excellence for this must try cigar, this cigar recommends you take on a weekend stroll through the park.'),(1317,'MONTECRISTO NO.2',5,47.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 52,  Cigar Lenght: 156mm/ 6.1 inches, Body: Medium',0,'N','','','N','N','N','This figurado is a long time favorite among cigar aficionados and is a \"Cuban classic\". Aesthetically, structurally and sensually the Monte # 2 is a benchmark for all Piramides in the bussiness. With its flicked, pointed cap, compact body and its thick 52 ring gauge the Monte # 2 looks mean and meaty. The blended master\'s proportions of ligero, seco and volado tobacco are poetic and result in a romantic smoke, a return to Havana on the spot. Ligero and seco tobacco from the paragon of soils in the Vuelta Abajo region spill into each other creating heady smoke full of dark chocolate, earth and oily spices. The volado tobacco and the conical tip used in the construction of the Monte # 2 ensure a pristine draw and glorious combustibility.'),(1318,'MONTECRISTO NO.4',5,24.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 42, Cigar lenght: 129mm/5.0 inches, Body: Medium',0,'N','','','N','N','N','This figurado is a long time favorite among cigar aficionados and is a \"Cuban Classic\". Aesthetically, structurally and sensually the Monet # 2 is the benchmark for all Piramides in the bussiness. With its flicked, pointed cap, compact body and its thick 42 ring gauge the Monet # 2 looks mean and meaty. The blended master\'s proportions of ligero, seco and volado tobacco are poetic and result in a romantic smoke, a return of Havana on the spot. Legero and seco tobacco from the paragon of soils in the Vuelta Abjon region spill into each other creating heady smoke full of dark chocolate, each earth and oily spices. The volado tobacco and the conical tip used in the construction of the Monet # 2 ensure a pristine draw the glorious combustibility.'),(1319,'MONTECRISTO GRAND EDMUNDO EDICON LIMITADA 2010',5,65.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 52, Cigar Length: 150mm/ 5.9 inches, Body: Medium-Full',0,'N','','','N','N','N','It is the first time that Habanos produces the Cononazo size outside the Cohiba brand. The Grande Edmundo Edicion Limitada provides all Montecristo\'s characteristic flavour in one of the most emblematic vitolas from Habanos. Limited by name and limited in quantity.'),(1320,'ROMEO Y JULIETA  SHORT CHURCHILLS',5,32.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 50, Cigar Length: 124 mm/ 4.8 inches, Body: Medium-Full',0,'N','','','N','N','N','A paramount display of Romeo Y Julieta\'s wide palette of flavours. Medium in strenght with notes of tangy orange peels, fragrant wood, fresh herbs, roasted hazelnuts and hints of leather fill the palate. A crisp start with an abundant smoke. This is a young and quite delicate cigar with a great ageing potential.'),(1321,'PARTAGAS LUSITANIAS',5,52.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 49, Cigar Lenght: 194 mm / 5.0 inches, Body: Medium',0,'N','','','N','N','N','A chivalrous cigar, a true knight in shinning armour! This double corona is crowned in a savoury balance of perfection, we must thank the Ligador for his masterful talents. The complexity of this stick needs a connoisseur\'s palate to distinguish the ripe fruit, pepper and amber from the initial nuances of hazelnut, butterscotch and moist earth.This is a silky, rich and dense smoke with a tight look and an even tighter feel. If you have 1 hr 30 mins - 2 hrs free and feel like wheelding this Lusitanias'),(1322,'PARTAGAS SERIE D NO.4',5,42.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 50, Cigar Length: 124 mm/ 4.8 inches , Body: Full',0,'N','','','N','N','N','A superb robusto, packed with Partagas powder. The secret of this robustos is that it creates the cool, round smoke wanted, yet it manages to release intense, complex flavours all in the most popular size, very clever indeed. Full boiled, rich and full cedar, chocolate and oak the no.4 is naturally for the experienced smoker who is seeking a robusto with brains.'),(1323,'PARTAGAS  SHORTS',5,19.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 42, Cigar Length: 110 mm/ 4.3 inches, Body: Full',0,'N','','','N','N','N','Unrivalled among the tres petit, this little chap is beautifully smooth , fresh and small making it perfect for biginners and intermediates alike. Bursting with vanilla, cedar, green pepper and peanut this cigar leaves a wash of sugar and creamy smoke on the palate'),(1324,'PARTAGAS SERIE D ESPECIAL EDICION LIMITADA 2010',5,58.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 50, Cigar Length: 141 mm /  5.5 inches, Body: Medium-Full',0,'N','','','N','N','N','Habanos have released this fabulous cigar as part of the 2010 Edicion Limitada series. The character and intense flavour of this Series D Especial Limitada is an excellent sample of the full flavour of the so much appreciated Series D of Partagas.'),(1325,'COHIBA SIGLO II',5,38.00,522,NULL,'N',31,NULL,'N','N','N',14.50,4.44,'Ring Gauge: 52, Cigar Length: 150 mm/ 5.0 inches, Body: Medium-Full',0,'N','','','N','N','N','This little Mareva, or Pedit Corona, has a sober and honest disposure. Made from the finest Vuelata Abajo tobacco, the Siglo II is inviting to look at, tender to touch and very enticing to the nose.An occasional resistance on the initial draw quickly quickly leads into a steady burn. White pepper and Cohiba trademark grassy qualities are clearly apparent in the first half of smoke. The second and third tier release cocoa and vanilla beans onto the palate through an impressively thick smoke. This Pedit Corona is a great work-out for the palate and a true example of the Cohiba \"blend master\'s\" diligence.'),(1326,'2 Roti, 1 Bowl Chawal, 1 Sabji, 1 Dal',5,90.00,527,NULL,'Y',32,NULL,'N','N','N',14.50,4.44,'Monthly 1700/- for 21 days\r\nMonthly 2400/- for 30 days',0,'N','','','N','N','N','2 Roti, 1 Bowl Chawal, 1 Sabji, 1 Dal\r\n'),(1327,'2Roti,1bowl Chawal,1Sabji,1Dal',5,90.00,527,NULL,'Y',32,NULL,'N','N','N